  "title":"La grenouille",
  "detail":"Le terme grenouille est un nom vernaculaire attribué à certains amphibiens, principalement dans le genre Rana. À un de ses stades de développement, la larve de la grenouille est appelée un têtard. Les grenouilles sont des quadrupèdes de l'ordre des anoures, tout comme les rainettes, qui sont en général plus vertes et arboricoles, les crapauds dont la peau est plus granuleuse et les xénopes strictement aquatiques. Tous ces termes usuels correspondent à des apparences extérieures plus qu'à des classements strictement taxinomiques.<br> Suivez le lien direct suivant pour en savoir plus :<br> <a href='http://fr.wikipedia.org/wiki/Grenouille' target='_blank'>http://fr.wikipedia.org/wiki/Grenouille</a> <br> Cela dit, une petite vidéo youtube serait peut-être la bienvenue :<br> <div class='videoWrapper4_3'><iframe src='http://www.youtube.com/embed/4E0-TgafTgg'></iframe></div> <br> ",
