  "title":"Les yeux de la chouette",
  "detail":"Parce que le détourage des yeux a été rempli de noir, l'image active comprend qu'il n'est pas zoomable.<br> Une petite question : D'où vient le terme <b>chouette</b> ?<br> Réponse:Le terme « chouette » dériverait de l'ancien français choue, supposé être issu du vieux bas francique *kawa, et partagerait la même étymologie que le terme choucas, un corvidé. La même racine semble se retrouver d'ailleurs dans de nombreuses langues nord-européennes comme dans kaie en norvégien.<br> Les premières attestations du terme, dont est issu « chouette » en français, date du XIe siècle sous la forme de çuete, chouate ou même choe",
